It’s the last day of school in Parkrose! It’s been an unprecedented spring in our district and I want to thank our students, families and staff for their patience and support. We are working hard to bring you more information about our reopening in the fall.
-Parkrose Superintendent Michael Lopes Serrao
@superparkrose

